import React from 'react';
import { Box, Grid } from '@mui/material';

const Component3 = () => {
  return (
    <Grid
      container
      spacing={2}
      sx={{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center',
      }}
    >
      {[...Array(6)].map((_, index) => (
        <Grid item xs={4} key={index}>
          <Box
            sx={{
              width: '100%',
              height: 120, // Điều chỉnh chiều cao ô
              bgcolor: '#e0e0e0',
              borderRadius: '10px', // Bo góc nhẹ cho ô
              display: 'flex',
              alignItems: 'center',
              justifyContent: 'center',
              fontSize: 18,
              fontWeight: 'bold',
            }}
          >
            Ô {index + 1}
          </Box>
        </Grid>
      ))}
    </Grid>
  );
};

export default Component3;
